pragma solidity ^0.5.0;

library Set {
    // We define a new struct datatype that will be used to
    // hold its data in the calling contract.
    struct Data {
        mapping(address => bool) flags;
    }

    // Note that the first parameter is of type "storage
    // reference" and thus only its storage address and not
    // its contents is passed as part of the call.  This is a
    // special feature of library functions.  It is idiomatic
    // to call the first parameter `self`, if the function can
    // be seen as a method of that object.
    function insert(Data storage self, address value)
        public
        returns (bool)
    {
        if (self.flags[value])
            return false; // already there
        self.flags[value] = true;
        return true;
    }

    function remove(Data storage self, address value)
        public
        returns (bool)
    {
        if (!self.flags[value])
            return false; // not there
        self.flags[value] = false;
        return true;
    }

    function contains(Data storage self, address value)
        public
        view
        returns (bool)
    {
        return self.flags[value];
    }
}

contract Job {
    address public _requester;
    uint private _total;
    uint private _amount;
    string private _content;
    uint private _current  = 0;
    address[] private workersArr;
    uint private workerCount;
    mapping(address => bool) public paid;
    mapping(address => string) private answers;
    Set.Data workers;

    event toVerification (
        address indexed id
    );

    event rejection (
        address indexed rejected
    );

    constructor(address requester, uint total, string memory content, uint money)
        public
        payable
    {
        require(money % total == 0);
        _requester = requester;
        _total = total;
        _amount = money;
        _content = content;

    }

    function getTotal()
        public
        view
        returns (uint)
    {
        return _total;
    }

    function getAmount()
        public
        view
        returns (uint)
    {
        return _amount;
    }

    function getContent()
        public
        view
        returns (string memory)
    {
        return _content;
    }

    function isPaying()
        public
        view
        returns (bool)
    {
        return _current  < _total;
    }

    function getAnswers(address f)
        public
        view
        returns (string memory)
    {
        require (msg.sender == _requester);
        return answers[f];
    }

    function addMoney()
        public
        payable
    {
        require((msg.value + _amount) % _total == 0);
        _amount += msg.value;
    }

    // fallback function
    function() external payable { }

    function stop()
        public
    {
        require (msg.sender == _requester);
        selfdestruct(msg.sender);
    }

    function accept(address payable target)
        public
        payable
    {
        require(msg.sender == _requester);
        require(!paid[target]);
        require(Set.contains(workers, target));
        require(_current  < _total);
        paid[target] = true;
        _current ++;
        target.transfer(_amount / _total);
    }

    function reject(address payable target)
        public
        payable
    {
        require(msg.sender == _requester);
        require(!paid[target]);
        require(Set.contains(workers, target));
        require(_current  < _total);
        emit rejection(target);
        answers[target] = '';
    }

    function answer(string calldata ans)
        external
    {
        answers[msg.sender] = ans;
        workersArr.push(msg.sender);
        if (Set.insert(workers, msg.sender))
            workerCount++;

        emit toVerification(msg.sender);
    }

    function getWorkers(uint number)
        public
        view
        returns (address)
    {
        require(msg.sender == _requester);
        require(number < workerCount);
        return workersArr[number];
    }

    function getNumberOfWorkers()
        public
        view
        returns (uint)
    {
        require(msg.sender == _requester);
        return workerCount;
    }

    function isPaid(address a)
        public
        view
        returns (bool)
    {
        return paid[a];
    }

    function myPay()
        public
        view
        returns (bool)
    {
        return paid[msg.sender];
    }

    function myAnswer()
        public
        view
        returns (string memory)
    {
        if (bytes(answers[msg.sender]).length == 0)
            return "";
        return answers[msg.sender];
    }
}

contract JobSet {
    Job[] public jobs;
    event newContract(Job indexed c);

    function createCC(uint workerCount, string memory content)
        public
        payable
        returns (Job)
    {
        require(msg.value % workerCount == 0,
            "Total reward should be evenly divided by the number of workers.");

        Job job = new Job(msg.sender, workerCount, content, msg.value);
        jobs.push(job);
        address(job).transfer(msg.value);

        emit newContract(job);
        return job;
    }

    function getContracCount()
        public
        view
        returns (uint)
    {
        return jobs.length;
    }
}
